import React, { Component } from "react";


import data from "./data/data.json";


const newdata = data.map(data => {
  return (
    <nav>
      <nav>
        <a href="#">{data.name}</a>
        <a href="#">{data.desc}</a>
        <a href="#">{data.price}</a>
      </nav>
    </nav>
  );
});

export default class Main extends Component {
  render() {
    return newdata;
  }
}
